function generateRandomString($minLength = 3, $maxLength = 12)
{
	$length = mt_rand($minLength, $maxLength);
	$characters = 'abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789';
	$randomString = '';

	$maxCharIdx = strlen($characters) - 1;
	for ($i = 0; $i < $length; $i++) {
		$randomString .= $characters[mt_rand(0, $maxCharIdx)];
	}

	return $randomString;
}


function esJSONValido($cadena)
{
	// Intenta decodificar la cadena JSON en modo estricto
	$resultado = json_decode($cadena, true, 512, JSON_THROW_ON_ERROR);

	// Verifica si hay errores al decodificar
	return !(json_last_error() === JSON_ERROR_SYNTAX || json_last_error() === JSON_ERROR_NONE);
